								<p>ROSA STEL, nacida en Pampaluna di Porpetto, Udine, el 24 / 024 / 04 / 1852.  Inmigraron ya casados a Federación, con los padres y hermanos de Angelo. Tras una década en la casa paterna en "El Bizcocho", se radicaron en la nueva Colonia Yeruá en 1889, donde vivieron, tuvieron todos sus hijos y murieron.
REFERENCIA: "En octubre de 1888 el Poder Ejecutivo envía al Congreso un proyecto de Ley para la compra de tierras destinadas a colonización: se adquieren así las tierras pertenecientes a la Estancia Yeruá, en el Dpto. de Concordia, junto al río.

" En 1892... Se contabilizaron doscientos veintidós familias instaladas en secciones de chacras: cincuenta argentinos, nueve orientales, 16 españoles, 49 italianos, 43 franceses, 36 alemanes, 2 ingleses y 4 suizos.(...) 37.844 hectáreas estaban cubiertas con maíz, maní, trigo, lino, viñas, tártago y tabaco. También en menor cantidad había frutales, alfalfa y hortalizas.

En las sección quintas, se ubicaron cuatro italianos</p>
