								<p>Inmigró  a  los  22  años  de  edad.  Casado en Federación,  Entre Ríos,  con Lucía Todone (Udine, 1867 - 3/9/1951). Pedro comenzó trabajando en Federación en el ferrocarril. Luego instaló una ladrillería y entonces edificó la casa grande  pegada a la que había ocupado con sus padres y hermanos cuando inmigraron. Tiempo después adquirió una importante extensión de campo y se dedicó a la agricultura y al cultivo de alfalfares, además de la cría de animales, siempre en la zona de El Bizcocho, Federación. Hasta sus hijos mayores hablaban friulano. Tuvieron 16.</p>
