								<p>Ambos nacidos en Udine, se conocieron en Chajarí y se casaron en Federación en noviembre de 1895. Dos años después se trasladaron a Colonia Yeruá con la familia de Ángel, el hermano mayor de José. Éste instaló un almacén de campo de ramos generales -tal vez una pulpería- , cuyo edificio se conserva actualmente. Alrededor de 1909 se radicaron definitivamente en  Concordia, donde montaron una empresa de servicios fúnebres que continúa activa en manos de algunos de sus descendientes.</p>
