								<p>Giuseppe, também conhecido como José ou Bepe Furlan, foi criado pela família Neu, e quando tinha 13 anos, juntamente com a família Neu, foi morar em Porto Alegre. 10 anos após, com 23 anos, Giuseppe voltou a Jaguari, para retomar a colônia. Como o pai tinha desaparecido e declarado ausente e a mãe falecida, tinha todo o direito de retomar a colônia. Ao chegar, morava um casal de emigrantes Austriacos: Leopoldo Felin e sua esposa Annita, com suas duas filhas.
Giuseppe se apaixonou pela bela jovem de 17 anos, Henriqueta Felin e em 04 de novembro de 1.899, casou e ficou morando na colônia, e com o casamento da outra filha com um Scalon e com a morte dos sogros, ficou de dono da colônia, até hoje preservada.</p>
